PANDAS_COL_REQUEST_TIME = u'Time'
PANDAS_COL_DEVICE_ID = u'DeviceID'

PANDAS_DATA_DICT = (
  (PANDAS_COL_DEVICE_ID, np.str, 1),
  (PANDAS_COL_REQUEST_TIME, np.str, 1),
  (u'tags', np.str, 1),
)

NAN = np.NaN
NAN_STR = r'\N'

PANDAS_COL_ENABLES = tuple(col_name for col_name, col_type, enable  in PANDAS_DATA_DICT if enable)
PANDAS_COL_NAMES =tuple(col_name for col_name, col_type, enable  in PANDAS_DATA_DICT)
PANDAS_COL_DTYPES = dict((col_name, col_type) for col_name, col_type, enable  in PANDAS_DATA_DICT)
PANDAS_COL_REMOVES =  (PANDAS_COL_REQUEST_TIME, PANDAS_COL_DEVICE_ID)

PANDAS_IMPORT_KWARGS = dict(sep='|', na_values =NAN_STR, engine='c', encoding='utf8',memory_map=True,
    header=None if PANDAS_COL_NAMES else 0, names=PANDAS_COL_NAMES, dtype=PANDAS_COL_DTYPES, usecols=PANDAS_COL_ENABLES,
    error_bad_lines=True, #warn_bad_lines=True,
)


PKL_MODEL = pickle.loads(base64.b64decode(''.strip()))

def predict_proba(items):
    '''if MODEL PREPROCESS / FEATURE ENGINEERING required, write below before the "return ..." line. '''
    return PKL_MODEL.predict_proba(items)

def format_output(req, fmt='json'):
    #req.ret = json.dumps(req.ret)
    csvio = six.StringIO()
    cw = csv.writer(csvio, delimiter='|', quotechar='"')
    cw.writerows(req.ret)
    req.ret = csvio.getvalue()


def format_input(req, fmt=None):  #### req.ioinput,  req.iodata
    req.data = pd.read_csv(StringIO(req.data), **PANDAS_IMPORT_KWARGS)

def process(req): #### req.data,
    if req.format == 'csv':
        items = []
        cols = zip( *req.data )
        for idx, (col, tp, enable) in enumerate(PANDAS_DATA_DICT):
            if not enable:
                continue
            items.append((col, map(lambda x: tp(x) if x.strip() else ('' if tp is np.str else 0), cols[idx])))
        req.data = pd.DataFrame.from_items(items)
    elif req.format == 'json':
        req.data = pd.DataFrame(req.data, columns=PANDAS_COL_NAMES, dtype=PANDAS_COL_DTYPES)
    times = req.data.pop(PANDAS_COL_REQUEST_TIME)
    deviceids = req.data.pop(PANDAS_COL_DEVICE_ID)
    scores =pd.Series(data=(round(i,6) for i in predict_proba(req.data.tags).T[1]),  dtype=np.float, name='Score', copy=False)
    data, req.data = req.data, None
    del data
    req.ret =zip(times, deviceids, scores)

